import React, { Component, Fragment } from 'react';
import Nav from './Nav';
import Header from './Header';
import Service from './Services';
import About from './About';
import Footer from './Footer';

class Home extends Component {

    render() {
        return (
            <Fragment>
                <Nav/>
                <Header/>
                <Service/>
                <About/>
                <Footer/>
            </Fragment>
        )
    }

}

export default Home;
